import React, { useState } from 'react';
import Gravity from "./Gravity";
import About from "./About";
import "../css/Main.css";
import gravity from "../img/gravity.webp";
import mhw from "../img/モンハン.webp";
import cs2 from "../img/cs2.webp";
import gold from "../img/gold.png";
import silver from "../img/silver.png";
import bronze from "../img/bronze.png";

function Main() {
    const [currentPage, setCurrentPage] = useState<string>("");

    const renderPage = () => {
        switch(currentPage){
            case "home":
                return <Gravity />;
            case "about":
                return <About />;
            default:
                return<>
                    <div className='wrapper'>
                        <h1 className='h'>TOP3 Games</h1>
                        <Crown />

                        <Image setCurrentPage={setCurrentPage} />

                        <Names setCurrentPage={setCurrentPage} />

                        <Catch />
                        <button onClick={() => setCurrentPage("gravity")}>ホーム</button>
                        <button onClick={() => setCurrentPage("about")}>アバウト</button>
                    </div>
                </>
        }
    };

    return (
        <>
            {renderPage()}
        </>
    );
}


const Crown = () => {
    return(
        <div className='crown'>
            <img className='bronze' src={bronze} alt='bronze' />
            <img className='gold' src={gold} alt='gold' />
            <img className='silver' src={silver} alt='silver' />
        </div>
    );
}

interface GameImagesProps{
    setCurrentPage: (page: string) => void;
}
const Image: React.FC<GameImagesProps> = ({setCurrentPage}) =>{
    return(
        <div className="imgs">
            <img className="gravity" src={gravity} alt="cat" onClick={() => setCurrentPage("home")}></img>
            <img className='cs2' src={cs2} alt="cs2"></img>
            <img className="mhw" src={mhw} alt="mhw"></img>
        </div>
    );
}

interface NamesProps{
    setCurrentPage: (page: string) => void;
}
const Names: React.FC<NamesProps> = ({setCurrentPage}) => {
    return(
        <div className='names'>
            <h2 className="gravity third" onClick={() => setCurrentPage("about")}>3rd. Gravity Daze</h2>
            <h2 className='cs2 first'>1st. Counter Strike</h2>
            <h2 className="mhw second">2nd. MonsterHunter WORLD</h2>
        </div>
    )
}

function Catch()
{
    return(
        <div className='cathc'>
            <h3>aaaaaaaaaaa</h3>
            <h3>aaaaaaaaaaa</h3>
            <h3>aaaaaaaaaaa</h3>
        </div>
    );
}

export default Main;
